import React, { useState, useEffect } from "react";
import Pagination from "@material-ui/lab/Pagination";

import { Container } from "./styles";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    "& > *": {
      marginTop: theme.spacing(2),
    },
  },
}));

export default function Playlist({ playlists }) {
  const classes = useStyles();

  console.log(playlists.playlists ? playlists.playlists : "j");
  return (
    <Container>
      <h1>Suas reproduções em destaque</h1>

      <section>
        {playlists.playlists
          ? playlists.playlists.items.map((playlist) => {
              return (
                <div key={playlist.id}>
                  <img src={playlist.images[0].url} alt="aqui" />

                  <h4>{playlist.name}</h4>

                  <p>{playlist.description}</p>
                </div>
              );
            })
          : null}
      </section>

      <div id="pagination" className={classes.root}>
        <Pagination count={10} variant="outlined" color="secondary" />
      </div>
    </Container>
  );
}
